const express = require("express");
const cors = require("cors");
const mysql = require("mysql2");
const bcrypt = require("bcrypt");
const jwt = require("jsonwebtoken");

const app = express();
const PORT = process.env.PORT || 5000;
const JWT_SECRET = "majayjaytourismcircuitsystem";

app.use(cors());
app.use(express.json());

const db = mysql.createPool({
  host: "localhost",
  user: "root",
  password: "",
  database: "majayjay_tourism",
  waitForConnections: true,
  connectionLimit: 10,
  queueLimit: 0
}).promise();

db.getConnection()
  .then(conn => {
    console.log("Connected to MySQL database");
    conn.release();
  })
  .catch(err => console.error("MySQL connection failed:", err.message));

const authenticateToken = (req, res, next) => {
  const authHeader = req.headers['authorization'];
  const token = authHeader && authHeader.split(' ')[1];
  if (!token) return res.status(401).json({ message: 'Access denied. No token provided.' });

  try {
    const decoded = jwt.verify(token, JWT_SECRET);
    req.user = decoded;
    next();
  } catch (err) {
    return res.status(403).json({ message: 'Invalid or expired token.' });
  }
};

const authenticateAdmin = (req, res, next) => {
  const authHeader = req.headers['authorization'];
  const token = authHeader && authHeader.split(' ')[1];
  if (!token) return res.status(401).json({ message: 'Access denied. No token provided.' });

  try {
    const decoded = jwt.verify(token, JWT_SECRET);
    req.user = decoded;

    db.query("SELECT role FROM users WHERE id = ?", [decoded.id])
      .then(([rows]) => {
        if (rows.length === 0) return res.status(404).json({ message: 'User not found' });
        if (rows[0].role !== 'admin') return res.status(403).json({ message: 'Access denied. Admins only.' });
        next();
      })
      .catch(err => res.status(500).json({ message: err.message }));
  } catch (err) {
    return res.status(403).json({ message: 'Invalid or expired token.' });
  }
};

app.post("/api/users/register", async (req, res) => {
  const { username, email, password, confirm_password } = req.body;
  if (!username || !email || !password || !confirm_password) return res.status(400).json({ success: false, message: "All fields are required" });
  if (password !== confirm_password) return res.status(400).json({ success: false, message: "Passwords do not match" });

  try {
    const [existingUser] = await db.query("SELECT id FROM users WHERE username = ? OR email = ?", [username, email]);
    if (existingUser.length > 0) return res.status(409).json({ success: false, message: "Username or email already exists" });

    const hashedPassword = await bcrypt.hash(password, 10);
    await db.query("INSERT INTO users (username, email, password_hash, role) VALUES (?, ?, ?, 'user')", [username, email, hashedPassword]);
    res.status(201).json({ success: true, message: "User registered successfully" });
  } catch (err) {
    res.status(500).json({ success: false, message: err.message });
  }
});

app.post("/api/users/login", async (req, res) => {
  const { email, password } = req.body;
  if (!email || !password) return res.status(400).json({ success: false, message: "Email and password are required" });

  try {
    const [users] = await db.query("SELECT * FROM users WHERE email = ?", [email]);
    if (users.length === 0) return res.status(400).json({ success: false, message: "Invalid email or password" });

    const user = users[0];
    const isMatch = await bcrypt.compare(password, user.password_hash);
    if (!isMatch) return res.status(400).json({ success: false, message: "Invalid email or password" });

    const token = jwt.sign({ id: user.id, email: user.email }, JWT_SECRET, { expiresIn: "1h" });
    res.json({ success: true, message: "Login successful", token, user: { id: user.id, username: user.username, email: user.email, role: user.role } });
  } catch (err) {
    res.status(500).json({ success: false, message: err.message });
  }
});

app.get("/api/pois", async (req, res) => {
  try {
    const [results] = await db.query("SELECT * FROM pois");
    res.json(results);
  } catch (err) {
    res.status(500).json({ error: "Database error" });
  }
});

app.get("/api/pois/:id", async (req, res) => {
  const { id } = req.params;
  try {
    const [results] = await db.query("SELECT * FROM pois WHERE id = ?", [id]);
    if (results.length === 0) return res.status(404).json({ message: "POI not found" });
    res.json(results[0]);
  } catch (err) {
    res.status(500).json({ error: "Database error" });
  }
});

app.post("/api/pois", authenticateAdmin, async (req, res) => {
  const { name, lat, lng, visitors, tags, description, image } = req.body;
  try {
    const [result] = await db.query("INSERT INTO pois (name, lat, lng, visitors, tags, description, image) VALUES (?, ?, ?, ?, ?, ?, ?)", [name, lat, lng, visitors, tags, description, image]);
    res.json({ success: true, id: result.insertId });
  } catch (err) {
    res.status(500).json({ error: "Database error" });
  }
});

app.listen(PORT, () => {
  console.log(`Server running at http://localhost:${PORT}`);
});
